import "./widgetSm.css";
import {useState,useEffect}from 'react'
import { Visibility } from "@material-ui/icons";
import { userRequest } from "../../requestMethod";

export default function WidgetSm() {
  const [users,setUsers]=useState([]);

  useEffect(() => {
  const getUsers = async()=>{
   try{ const res = await userRequest.get("/user/?new=true");
  setUsers(res.data)} 
catch(err){}}
  
    getUsers()
  }, []);
  return (
    <div className="widgetSm">
      <span className="widgetSmTitle">New Join Members</span>
      <ul className="widgetSmList">
        {users.map((user) => (
        <li className="widgetSmListItem" key={user.id}>
          <img
            src={users.img || "https://images.pexels.com/photos/3992656/pexels-photo-3992656.png?auto=compress&cs=tinysrgb&dpr=2&w=500"}
            alt=""
            className="widgetSmImg"
          />
          <div className="widgetSmUser">
            <span className="widgetSmUsername" >{user.username}</span>
      
          </div>
          <button className="widgetSmButton">
            <Visibility className="widgetSmIcon" />
            Display
          </button>
        </li>))}
      
      
        
       
      </ul>
    </div>
  );
}
